propBlk = [blkName, '/Data Type Propagation'];

if strcmp(OutputDataTypeScalingMode, 'Same as second input')
    set_param(propBlk, 'PropDataTypeMode', 'Inherit via propagation rule', ...
                       'PropScalingMode',  'Inherit via propagation rule');
else
    scaling = OutScaling;
    scalingMode = 'Specify via dialog';
    switch OutputDataTypeScalingMode
      case 'double'
        dataType = 'fixdt(''double'')';
      case 'single'
        dataType = 'fixdt(''single'')';
      case 'int8'
        dataType = 'fixdt(1,8,0)';
      case 'uint8'
        dataType = 'fixdt(0,8,0)';
      case 'int16'
        dataType = 'fixdt(1,16,0)';
      case 'uint16'
        dataType = 'fixdt(0,16,0)';
      case 'int32'
        dataType = 'fixdt(1,32,0)';
      case 'uint32'
        dataType = 'fixdt(0,32,0)';
      case 'Specify via dialog'
        dataType = OutDataType;
        if ~isempty(OutDataTypeStr) && isa(OutDataTypeStr,'Simulink.NumericType') 
          if strcmp(OutDataTypeStr.DataTypeMode, 'Fixed-point: unspecified scaling') 
            scalingMode = 'Obtain via best precision';
            range = [OutMin OutMax];
            range = range(~isinf(range));
            set_param(propBlk, 'ValuesUsedBestPrec', mat2str(range));
          end
        end
    end

    set_param(propBlk, 'PropDataTypeMode', 'Specify via dialog', ...
                       'PropScalingMode',  scalingMode, ...
                       'PropDataType',     dataType, ...
                       'PropScaling',      scaling);
end

